class Pixel {
    constructor(x, y, val) {
        this.x = x;
        this.y = y;
        this.w = 30;
        this.h = 30;
        this.val = val;

       
    }

   

    draw(ctx) {
        ctx.beginPath();
        ctx.rect(
            -this.w/2,
            -this.h/2,
            this.w,
            this.h
        );
        ctx.fill();
    }
}
